import React, { useState, useEffect } from 'react'
import axios from 'axios'
import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';
import doc2 from '../../resources/doc2.png'
import '../../App.css'
import Container from 'react-bootstrap/Container';

const Doctor = () => {

    useEffect(()=>{
        axios.get("http://localhost:5001/doctors").then((response)=>{
            setListOfDoctors(response.data)
        })
      },[])

      const [listOfDoctors, setListOfDoctors] = useState([]);

  return (
    <div>
        <h1>Our Doctors</h1>
        <div className='Doctors'>
        {listOfDoctors.map((value, key)=>{
            return( 

                <Container>
                <div className='listOfDoctors'>
                    <Card style={{ width: '13rem' }}>
                    
                        <div className='listOfDoctorsContainer'>
                
                        
                            <Card.Img variant="top" src={doc2} className='doc-list-logo'/>
                            
                                <Card.Body>
                                
                                    <Card.Title className='doctorname'>{value.doctorName}</Card.Title>
                                    <Card.Text className='doctorspecialization'>{value.doctorSpecialization}</Card.Text>
                                    
                                </Card.Body>
                                
                                <ListGroup className="doctorEmail info" >
                                    <ListGroup.Item variant="info">{value.doctorEmail}</ListGroup.Item>
                                </ListGroup>
                        </div>
                        
                    </Card>
                </div>
                </Container>
            ) 

        })}
        </div>
    </div>
  )
}

export default Doctors
